import { Box } from "@mui/material";
import Post from "scenes/widgets/Post";
import UserWidget from "scenes/widgets/UserWidget";

const HomePage = () => {
  return (
    <Box disp>
      <UserWidget />
      <Post />
    </Box>
  );
};

export default HomePage;
